Todavía hay mucho que podemos hacer y conocer en nuestra querida ciudad capital, te enseñamos los lugares que no puedes dejar de conocer 🧐⁣
⁣
✨ Parque Nacional El Ávila: subir al teleférico y admirar desde arriba toda Caracas. También puedes subir hasta Galipán y comerte un sándwich de pernil y unas fresas con crema⁣
⁣
✨ Paseo Los Próceres: debes pasear por Los Próceres y recordar a todos los protagonistas de nuestro proceso de independencia⁣
⁣
✨ Plaza Los Museos: a escasos metros de la estación de metro Bellas Artes puedes recorrer los Museos de Bellas Artes y de Ciencias Naturales, y tomarte un jugo exótico en el quiosco que está en la Plaza de los Museos⁣
⁣
✨ Parque Generalísimo Francisco de Miranda: conocido como el Parque del Este es el lugar ideal para el esparcimiento del caraqueño, además de ser un importante pulmón verde de la ciudad, que puedes visitar en tu viaje a la capital⁣
⁣
✨ Esfera de Soto: conoce la escultura “Esfera de Caracas” de Jesús Soto especialmente todo de noche cuando está iluminada, este lugar se ha convertido en una parada obligatoria⁣
⁣
✨ Pueblo El Hatillo: conoce el hermoso pueblo de El Hatillo y entra a la tienda Hannsi, también debes probar una de las muchas tortas que venden frente a la Plaza Bolívar y degustar comida típica venezolana en el restaurant La Gorda, donde hasta el mismísimo Gabriel García Márquez se sentó⁣
⁣
